import React from "react";
import img from '../src/Images/img.avif'
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import { NavLink } from "react-router-dom";
const Home = () => {
  return (
    <>
      <CommonComp
        name="Welcome to About Page"
        imgsrc={img}
        visit="/service"
        btnName="Contact Now"
      />
    </>
  );
};

export default Home;
